INSERT INTO `t_view_service` VALUES (1,'Exámenes médicos ocupacionales','<strong>*</strong> Evaluación médica pre ocupacional.<br>\t\r\n<strong>*</strong> Evaluación médica ocupacional periódica.<br>\t\r\n<strong>*</strong> Evaluación médica por cambio de puesto.<br>\t\r\n<strong>*</strong> Evaluación médica por reinserción laboral.<br>\t\r\n<strong>*</strong> Evaluación médica post ocupacional (retiro).<br>\t\r\n<strong>*</strong> Evaluación médica IN HOUSE.\r\n\r\n\r\n','SERVICIOS-01 (1).png',NULL,'services-01.jpg','icon-cardiology'),(5,'Monitoreos ergonómicos y de riesgos psicosociales.','Evaluaciones para identificación de factores de riesgo psicosocial y el impacto psicológico que aquellos producen en los trabajadores.\nEvaluaciones ergonómicas en los puestos de trabajo.','SERVICIOS-01 (5).png',NULL,'services-05.jpg','icon-terapevt'),(6,'Vigilancia médica','<strong>*</strong> Vigilancia médica ocupacional (asesoría y supervisión).<br>\r\n<strong>*</strong> Supervisiones periódicas opinadas e inopinadas del sistema de gestión en la seguridad de la empresa.<br>\r\n<strong>*</strong> Evaluaciones de aptitud médica y psicológica para postulantes al puesto de brigadista.<br>\r\n<strong>*</strong> Capacitaciones / charlas / talleres en salud ocupacional.\r\n\r\n','SERVICIOS-01 (4).png',NULL,NULL,'icon-team'),(7,'Auditorías','Evalúa el Sistema de Gestión de Seguridad y Salud en cada uno de los procesos y actividades de los colaboradores en forma sistemática con el objeto de minimizar los riesgos y corregir las desviaciones de los estándares en los que se basa el programa de control de riesgos, y proporcionar oportunidades para medir las exigencias del objetivo programado.\n','SERVICIOS-01 (2).png',NULL,'services-04.jpg','icon-pencil-writing'),(8,'Capacitaciones en salud, seguridad e higiene empresarial','El trabajador debe recibir elementos teóricos y prácticos de prevención y control de enfermedades comunes y profesionales, accidentes e incidentes y primeros auxilios, esto contribuye a la corrección de actitudes del personal en el puesto de trabajo.\n','SERVICIOS-01 (3).png',NULL,'services-03.jpg','icon-doctor');
/*!40000 ALTER TABLE `t_view_service` ENABLE KEYS */;

