INSERT INTO `th_employe` VALUES (1,' Av. Canadá 1335 - 1339, La Victoria, Lima, Perú','ventas@innomedic.pe',' Av. Canadá 1335 - 1339, La Victoria, Lima, Perú',' Av. Javier Prado Este 2638, San Borja, Lima, Perú','(+51) 946 887 798','(+51)914007682','https://es-la.facebook.com/InnomedicInternational/','https://www.instagram.com/innomedic_internacional/','https://twitter.com/Innomedic_Peru',NULL,'<h3 class=\" theme-color display-5 \">Misi&oacute;n&nbsp;</h3>\n<p class=\" text-justify \">Brindar un servicio de calidad a los colaboradores de nuestros clientes, asegur&aacute;ndonos que sean atendidos de la mejor manera y que sientan la seguridad de nuestras evaluaciones y resultados.</p>\n<h3 class=\" theme-color \">Visi&oacute;n&nbsp;</h3>\n<p class=\" text-justify \">Ser reconocidos como un centro de evaluaciones ocupacionales de prestigio gracias a la calidez de nuestro trato, el cumplimiento de los acuerdos con nuestros clientes, el recurso humano con el que contamos y la tecnolog&iacute;a e infraestructura de la que disponemos, todo esto con el respaldo de nuestros clientes.</p>\n','<p class=\"text-justify \">Innomedic es una clínica con mas de 7 a&ntilde;os de experiencia en el mercado especializado en el servicio de Salud Ocupacional, brinda servicios de calidad que nos permite garantizar el cumplimiento de todas las evaluaciones de acuerdo a la ley 29783.<strong> Ley de Seguridad y Salud en el trabajo, su reglamento&nbsp;</strong><strong>y modificaci&oacute;n Ley N&ordm; 30222.</strong></p>\n<p><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.innomedic.pe/assets/images/content/xxxxxxxx.png\" alt=\"DIGESA\"/></strong></p>','Para recibir comunicados por correo electrónico, simplemente proporcione\r\nsu correo electrónico a continuación',NULL,'logo.png','https://www.linkedin.com/in/innomedic-international-300125ba/');

