INSERT INTO `ts_comunicados` VALUES (1,'<center><h1><span style=\"color: #000000;\"><strong>Feliz Cummpleaños Ismar</strong></span></h1>\r\n</center>\r\n',15,'2020-02-26 14:04:48','2020-02-26 14:04:48',0,'','MELISSA SALAS CHILO',X'4172636869766F735F35363938303331383230383031313469736D61722E6A7067','7','0','0'),(3,'<center><h1><span style=\"color: #000000;\"><strong>&iexcl;Muchas felicidades Dra. Karla y Lic. Erika Picoy! Que tengan un excelente d&iacute;a, &eacute;xitos siempre</strong></span></h1>\r\n</center>\r\n<img  src=\"../upload/archivos/saludos.lisra.jpg\" alt=\"\" />\r\n<p>&nbsp;</p>',1,'2020-03-06 12:15:43','2020-03-06 12:15:43',0,'Usuario403320946750419e10ea0c418c37791dddfb85488f0efa2.jpg','Evaristo Escudero   Huillcamascco',X'','7','0','0'),(4,'habilitar el alcohol gel',56,'2020-03-11 13:06:41','2020-03-11 13:06:41',0,'','CESAR HUGO CHAPARRO TRUJILLO',X'','1','0','0'),(5,'<h1 class=\"Format1__title\">Universitario: Juan Pajuelo es el DT interino, anuncia el gerente deportivo</h1>\r\n<div class=\"Format1__bajada\">\r\n<p>&nbsp;</p>\r\n<h2>El gerente deportivo, designado por&nbsp;<strong>Carlos Moreno</strong>, se&ntilde;al&oacute; que&nbsp;<a href=\"https://libero.pe/tag/juan-pajuelo\">Juan Pajuelo</a>&nbsp;ya fue notificado y se har&aacute; cargo del primer equipo de&nbsp;<a href=\"https://libero.pe/tag/universitario\">Universitario</a>&nbsp;e incluso podr&iacute;a iniciar los trabajos el 22 de junio.</h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"Format1__container-image\">\r\n<div class=\"org-mod-carousel_Format8\">\r\n<div class=\"Format8__slide js_Slick_slideFormat8\">\r\n<div id=\"noticias-slider\" class=\"js-Carousel js-Carousel_slide-container\">\r\n<ul>\r\n<li class=\"js-Carousel_slide-items js-Carousel_active\">\r\n<div class=\"mol-slider-news\">\r\n<figure class=\"atm_Img-cover mol-slider-news_figure\"><picture><source srcset=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592001398-juan-pajuelo-universitario.jpg\" media=\"(min-width: 650px)\" data-original-set=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592001398-juan-pajuelo-universitario.jpg\" /><source srcset=\"https://prod.media.libero.pe/538x300/libero/imagen/2020/06/12/noticia-1592001398-juan-pajuelo-universitario.jpg\" media=\"(min-width: 465px)\" data-original-set=\"https://prod.media.libero.pe/538x300/libero/imagen/2020/06/12/noticia-1592001398-juan-pajuelo-universitario.jpg\" /><img class=\"Img-conver__img js_load_Img initial loaded\" title=\"Juan Pajuelo como DT interino de Universitario en el 2015.\" role=\"none\" src=\"https://prod.media.libero.pe/342x192/libero/imagen/2020/06/12/noticia-1592001398-juan-pajuelo-universitario.jpg\" alt=\"Juan Pajuelo\" width=\"342\" height=\"192\" data-original=\"https://prod.media.libero.pe/342x192/libero/imagen/2020/06/12/noticia-1592001398-juan-pajuelo-universitario.jpg\" data-was-processed=\"true\" /></picture></figure>\r\n<div class=\"mol-slider-news_detail\">\r\n<div class=\"mol-slider-news_text mol-slider-news_detail_left\">\r\n<div class=\"mol-slider-news_title\">Juan Pajuelo como DT interino de Universitario en el 2015.</div>\r\n&nbsp;<span class=\"mol-slider-news_countSlider\">1 de 5</span></div>\r\n</div>\r\n</div>\r\n</li>\r\n<li class=\"js-Carousel_slide-items\">\r\n<div class=\"mol-slider-news\">\r\n<figure class=\"atm_Img-cover mol-slider-news_figure\"><picture><source srcset=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-2.jpg\" media=\"(min-width: 650px)\" data-original-set=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-2.jpg\" /><source srcset=\"https://prod.media.libero.pe/538x300/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-2.jpg\" media=\"(min-width: 465px)\" data-original-set=\"https://prod.media.libero.pe/538x300/libero/imagen/2020/06/12/noticia-1592002791-juan-pajue