192/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-3.jpg\" data-was-processed=\"true\" /></picture></figure>\r\n<div class=\"mol-slider-news_detail\">\r\n<div class=\"mol-slider-news_text mol-slider-news_detail_left\">\r\n<div class=\"mol-slider-news_title\">Juan Pajuelo conversando con &Aacute;ngel Comizzo en el 2019.</div>\r\n&nbsp;<span class=\"mol-slider-news_countSlider\">3 de 5</span></div>\r\n</div>\r\n</div>\r\n</li>\r\n<li class=\"js-Carousel_slide-items\">\r\n<div class=\"mol-slider-news\">\r\n<figure class=\"atm_Img-cover mol-slider-news_figure\"><picture><source media=\"(min-width: 650px)\" data-original-set=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-4.jpg\" /><source media=\"(min-width: 465px)\" data-original-set=\"https://prod.media.libero.pe/538x300/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-4.jpg\" /><img class=\"Img-conver__img js_load_Img\" title=\"Juan Pajuelo durante su etapa como asistente de Roberto Chale.\" role=\"none\" src=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-4.jpg\" alt=\"Juan Pajuelo\" width=\"342\" height=\"192\" data-original=\"https://prod.media.libero.pe/342x192/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-4.jpg\" /></picture></figure>\r\n<div class=\"mol-slider-news_detail\">\r\n<div class=\"mol-slider-news_text mol-slider-news_detail_left\">\r\n<div class=\"mol-slider-news_title\">Juan Pajuelo durante su etapa como asistente de Roberto Chale.</div>\r\n&nbsp;<span class=\"mol-slider-news_countSlider\">4 de 5</span></div>\r\n</div>\r\n</div>\r\n</li>\r\n<li class=\"js-Carousel_slide-items\">\r\n<div class=\"mol-slider-news\">\r\n<figure class=\"atm_Img-cover mol-slider-news_figure\"><picture><source media=\"(min-width: 650px)\" data-original-set=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-5.jpg\" /><source media=\"(min-width: 465px)\" data-original-set=\"https://prod.media.libero.pe/538x300/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-5.jpg\" /><img class=\"Img-conver__img js_load_Img\" title=\"Juan Pajuelo durante su etapa como capit&aacute;n de Universitario.\" role=\"none\" src=\"https://prod.media.libero.pe/660x392/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-5.jpg\" alt=\"Juan Pajuelo\" width=\"342\" height=\"192\" data-original=\"https://prod.media.libero.pe/342x192/libero/imagen/2020/06/12/noticia-1592002791-juan-pajuelo-universitario-5.jpg\" /></picture></figure>\r\n<div class=\"mol-slider-news_detail\">\r\n<div class=\"mol-slider-news_text mol-slider-news_detail_left\">\r\n<div class=\"mol-slider-news_title\">Juan Pajuelo durante su etapa como capit&aacute;n de Universitario.</div>\r\n&nbsp;<span class=\"mol-slider-news_countSlider\">5 de 5</span></div>\r\n</div>\r\n</div>\r\n</li>\r\n</ul>\r\n<div class=\"js-Carousel_slide-buttons js-Carousel_slide-button-next\">&nbsp;</div>\r\n<div class=\"js-Carousel_slide-buttons js-Carousel_slide-button-prev\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"PostInternalBlockLeft__container fixed-aside-left\">\r\n<div class=\"col-4-md col-4-sm PostInternalBlockLeft__left\">\r\n<div class=\"PostInternal_list-social\">&nbsp;</div>\r\n<p class=\"date-post-description\">Redacci&oacute;n :<br /><br /><strong>Libero</strong></p>\r\n<p class=\"date-post-description\">12 Jun 2020 | 17:36 h</p>\r\n</div>\r\n<div class=\"col-16-md col-16-sm PostInternalBlockLeft__right\">\r\n<div class=\"Format1__description\">\r\n<p>Mientras se sigue hablando de la salida de&nbsp;<a href=\"https://libero.pe/tag/gregorio-perez\">Gregorio P&eacute;rez</a>, en&nbsp;<a href=\"https://libero.pe/tag/universitario\">Universitario de Deportes</a>&nbsp;ya van planificando los siguientes d&iacute;as de trabajo remoto mientras se regresa a los entrenamientos en cancha bajo el estricto protocolo que manda la Federaci&oacute;n Peruana de F&uacute;tbol. Es as&iacute; que&nbsp;<strong>Francisco Gonzales</strong>, en charla con&nbsp;<strong>L&Iacute;BERO</strong>, confirm&oacute; que&nbsp;<a href=\"https://libero.pe/tag/juan-pajuelo\">Juan Pajuelo</a>&nbsp;ya fue avisado de que se har&aacute; cargo del primer equipo de manera interina.</p>\r\n</div>\r\n</div>\r\n</div>',1,'2020-06-13 09:17:21','2020-06-13 09:17:21',0,'Usuario403320946750419e10ea0c418c37791dddfb85488f0efa2.jpg','Evaristo Escudero Huillcamascco',X'','1','0','0');

